/* 3-SAT solver! naive implementation of schning's probabilistic algorithm */

#define MAXCL 500
#define MAXVAR 100

int clause[MAXCL][3]; /* 1-indexed, negative means negation */
int var[MAXVAR];      /* 0-indexed */
int n;                /* number of clauses */
int m;                /* number of variables */

int sat3() {
	int i,j,N=3*n,tries;
	for(tries=1;;tries++) {
		/* init: random assignment */
		for(i=0;i<n;i++) var[i]=(rand()>>14)&1;
		while(N--) {
			/* scan until we find an unsolved clause */
			for(i=0;i<m;i++) {
				for(j=0;j<3;j++) {
					if(clause[i][j]>0 && var[clause[i][j]-1]) goto ok;
					if(clause[i][j]<0 && !var[-clause[i][j]-1]) goto ok;
				}
				goto notok;
			ok:;
			}
			/* couldn't find any unsolved clauses, so we succeeded! */
			return 1;
		notok:
			/* flip random variable in clause */
			j=rand()%3;
			if(clause[i][j]>0) var[clause[i][j]-1]^=1;
			else var[-clause[i][j]-1]^=1;
		}
		/* no solution, restart. if we are trying to solve unsolvable instances, we
		   might want to cap the number of tries */
	}
	return 0;
}

#define MAXX 97
#define MAXY 116

int level[MAXX][MAXY];
int x,y;

int can(int i,int j,int dx,int dy) {
	int k;
	if(level[i][j]) return 0;
	for(k=0;k<3;k++) {
		i+=dx; j+=dy;
		if(i<0 || j<0 || i>=x || j>=y) return 0;
		if(level[i][j]<200 || level[i][j]>399) return 0;
	}
	return 1;
}

void find(int v,int *x1,int *y1) {
	int i,j;
	for(i=0;i<x;i++) for(j=0;j<y;j++) if(level[i][j]==v) { *x1=i,*y1=j; return; }
	printf("error");
	*x1=*y1=0;
}

#define MAXQ 30000

int q[MAXQ],qs,qe;
signed char prev[MAXX][MAXY];
char sol[MAXQ];
int sn;

int dx[]={1,0,-1,0};
int dy[]={0,1,0,-1};
char dir[]="RDLU";

/* output path between (sx,sy) and (gx,gy) */
void bfs(int sx,int sy,int gx,int gy) {
	int curx,cury,x2,y2,d,door;
	qs=qe=0;
	memset(prev,-1,sizeof(prev));
	/* push starting position */
	q[qe++]=sx; q[qe++]=sy;
	prev[sx][sy]=0;
	while(qs<qe) {
		curx=q[qs++]; cury=q[qs++];
		for(d=0;d<4;d++) {
			x2=curx+dx[d]; y2=cury+dy[d];
			if(x2<0 || y2<0 || x2>=x || y2>=y || !level[x2][y2] || prev[x2][y2]>-1) continue;
			/* don't enter closed door */
			if(level[x2][y2]>=200) {
				door=level[x2][y2]%100;
				if((level[x2][y2]-200)/100==var[door]) continue;
			}
			q[qe++]=x2; q[qe++]=y2;
			prev[x2][y2]=dir[d];
			if(x2==gx && y2==gy) goto solved;
		}
	}
	printf("sanity error, couldn't find solution.\n");
	return;
solved:
	sn=0;
	while(prev[x2][y2]) {
		sol[sn++]=prev[x2][y2];
		switch(prev[x2][y2]) {
		case 'L':
			x2++;
			break;
		case 'R':
			x2--;
			break;
		case 'U':
			y2++;
			break;
		case 'D':
			y2--;
		}
	}
	while(--sn>-1) putchar(sol[sn]);
}

void solve() {
	int i,j,k,x1,y1,x2,y2;
	n=m=0;
	/* identify clauses */
	for(i=0;i<x;i++) for(j=0;j<y;j++) {
		/* horizontal */
		if(can(i,j,1,0)) {
			for(k=1;k<4;k++) {
				if(level[i+k][j]>=200 && level[i+k][j]<300) clause[m][k-1]=level[i+k][j]-199;
				else clause[m][k-1]=-level[i+k][j]+299;
			}
			m++;
		}
		/* vertical */
		if(can(i,j,0,1)) {
			for(k=1;k<4;k++) {
				if(level[i][j+k]>=200 && level[i][j+k]<300) clause[m][k-1]=level[i][j+k]-199;
				else clause[m][k-1]=-level[i][j+k]+299;
			}
			m++;
		}
	}
	for(i=0;i<m;i++) for(j=0;j<3;j++) {
		if(clause[i][j]>0 && n<clause[i][j]) n=clause[i][j];
		if(clause[i][j]<0 && n<-clause[i][j]) n=-clause[i][j];
	}
	sat3();
	/* create path! find starting position */
	find(2,&x2,&y2);
	/* for each variable we set, push button */
	for(i=0;i<n;i++) if(var[i]) {
		x1=x2; y1=y2;
		find(100+i,&x2,&y2);
		bfs(x1,y1,x2,y2);
		putchar('P');
	}
	/* go to exit */
	x1=x2; y1=y2;
	find(3,&x2,&y2);
	bfs(x1,y1,x2,y2);
	putchar('\n');
}

int main() {
	int i,j,T=0;
	/* level 1 */
	x=widths[T]; y=heights[T];
	for(i=0;i<x;i++) for(j=0;j<y;j++) level[i][j]=level0[j][i];
	solve();
	T++;
	/* level 2 */
	x=widths[T]; y=heights[T];
	for(i=0;i<x;i++) for(j=0;j<y;j++) level[i][j]=level1[j][i];
	solve();
	T++;
	/* level 3 */
	x=widths[T]; y=heights[T];
	for(i=0;i<x;i++) for(j=0;j<y;j++) level[i][j]=level2[j][i];
	solve();
	T++;
	/* level 4 */
	x=widths[T]; y=heights[T];
	for(i=0;i<x;i++) for(j=0;j<y;j++) level[i][j]=level3[j][i];
	solve();
	T++;
	/* level 5 */
	x=widths[T]; y=heights[T];
	for(i=0;i<x;i++) for(j=0;j<y;j++) level[i][j]=level4[j][i];
	solve();
	T++;
	/* level 6 */
	x=widths[T]; y=heights[T];
	for(i=0;i<x;i++) for(j=0;j<y;j++) level[i][j]=level5[j][i];
	solve();
	T++;
	/* level 7 */
	x=widths[T]; y=heights[T];
	for(i=0;i<x;i++) for(j=0;j<y;j++) level[i][j]=level6[j][i];
	solve();
	return 0;
}
